import { useNavigate, useParams } from "react-router-dom";
import { Form } from "react-bootstrap";
import { useContext, useState } from "react";
import { Button } from "react-bootstrap";
import axios from "axios";
import { apiUrl } from "../components/constant";
import { PostContext } from "../App";
export default function PostEditScreen() {
  const navigate = useNavigate();
  const { userInfo } = useContext(PostContext);
  const params = useParams();
  const { id: postId } = params;
  const [title, setTitle] = useState();
  const [slug, setSlug] = useState();

  const [image, setImage] = useState();

  const [category, setCategory] = useState();

  const [content, setContent] = useState();
  const submitHandler = async (e) => {
    e.preventDefault();
    try {
      await axios.put(
        `${apiUrl}/api/posts/${postId}`,
        {
          _id: postId,
          title,
          slug,
          image,
          category,
          content,
        },
        {
          headers: { Authorization: `Bearer ${userInfo.token}` },
        }
      );

      navigate("/admin/listposts");
    } catch (err) {
      console.log(err);
    }
  };
  return (
    <>
    <div className="container_form">
        <div className="container_wrap">
          <form onSubmit={submitHandler}>
            <h1>Sign In</h1>
            <div className="mb-3 email">
              <h5>Email address</h5>

              <input
                type="email"
                className="form-control"
                placeholder="Enter email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
              />
            </div>
            <div className="mb-3 password">
              <h5>Password</h5>
              <input
                type="password"
                className="form-control"
                placeholder="Enter password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
              />
            </div>

            <div className="d-grid">
              <button type="submit" className="btn btn-primary login_btn">
                Submit
              </button>
            </div>
            <p className="forgot-password text-right dangky">
              Bạn chưa tạo tài khoản? <a href="/api/users/signup">Đăng ký</a>
            </p>
          </form>
        </div>
      </div>
      <h1>Edit post {postId}</h1>
      <Form onSubmit={submitHandler}>
        <Form.Group className="mb-3 email" controlId="title">
          <Form.Label>Title</Form.Label>
          <Form.Control
            value={title}
            onChange={(e) => setTitle(e.target.value)}
            required
          />
        </Form.Group>
        <Form.Group className="mb-3 email" controlId="slug">
          <Form.Label>Slug</Form.Label>
          <Form.Control
            value={slug}
            onChange={(e) => setSlug(e.target.value)}
            required
          />
        </Form.Group>
        <Form.Group className="mb-3 email" controlId="image">
          <Form.Label>Image</Form.Label>
          <Form.Control
            value={image}
            onChange={(e) => setImage(e.target.value)}
            required
          />
        </Form.Group>
        <Form.Group className="mb-3 email" controlId="category">
          <Form.Label>Category</Form.Label>
          <Form.Control
            value={category}
            onChange={(e) => setCategory(e.target.value)}
            required
          />
        </Form.Group>

        <Form.Group className="mb-3 email" controlId="content">
          <Form.Label>Content</Form.Label>
          <Form.Control
            value={content}
            onChange={(e) => setContent(e.target.value)}
            required
          />
        </Form.Group>

        <div className="mb-3">
          <Button type="submit">Update</Button>
        </div>
      </Form>
    </>
  );
}
